import scissors from '../../../pictures/scissors3.png';
import razor from '../../../pictures/razor3.png';
import both from '../../../pictures/both.png';


const services = [
    {
        id: 1,
        img: {scissors},
        name: 'Scissor Cut And Style',
        price: '40zł'
    },
    {
        id: 2,
        img: {razor},
        name: 'Beard Trim With Razor',
        price: '30zł'
    },
    {
        id: 3,
        img: {both},
        name: 'Scissor Cut + Beard Trim',
        price: '60zł'
    },
];

export default services;
